import React from 'react'


const a = prompt("Entre your first value") 
const b = prompt("Entre your second value") 

const test = () => {
    return (
        <>
        <h1>Hlo {{a}}</h1>
        <h1>Hlo {{b}}</h1>
            
        </>
    )
}

export default test
